import React from 'react'
import BusinessIcon from '@material-ui/icons/Business';
import HomeIcon from '@material-ui/icons/Home';
import styled from 'styled-components';
import SearchIcon from '@material-ui/icons/Search';
import {Avatar} from '@material-ui/core'
import ChatIcon from '@material-ui/icons/Chat';
import AddBoxTwoToneIcon from '@material-ui/icons/AddBoxTwoTone';
import { Link } from 'react-router-dom';
const Nav = styled.nav`
  display:flex;
  justify-content:space-between;
  padding:15px 20px;
  position:sticky;
  align-items:center;
  z-index:100;
  top:0px;
  box-shadow:0px 5px 8px -9px rgba(0,0,0,0.75) ;
`
const AddAnnoce = styled(AddBoxTwoToneIcon)`
  height:40px;
  ${'' /* width:100%; */}
  color:gray;
  cursor:pointer;
  background-color:#eff2f5;
`
const MLink = styled(Link)`
  display:flex;
  jusify-content:center;
  align-items:center;
  height:40px;
  width:25%;
  ${'' /* border-radius:50px; */}
  background-color:#eff2f5;
  margin-left:5px;
  text-decoration:none;
  color:#000;
`
const SearchInfo = styled.div`
  display:flex;
  jusify-contet:center;
  align-items:center;
  background-color:#eff2f5;
  padding:10px;
  margin-left:10px;
  border-radius:999px;
  @media screen and (max-width:768px){
    display:none;
  }
`
const Search = styled.input`
    border:none;
    background-color:transparent;
    outline-width:0;  
`
const HomLogo = styled(HomeIcon)`
  color:gray;
  height:40px;
  margin-right:30px;
  ${'' /* margin:0px  20px; */}
`
const Logo = styled(BusinessIcon)`
  display:flex;
  height:100%;
  width:40px;
  color:gray;
  padding-right:40px;
`
const Chat = styled(ChatIcon)`
  margin:0px 30px;
  color:gray;
`
const HeaderInfo = styled.div`
  display:flex;
  jusify-content:center;
  align-items:center;
  ${'' /* width:5rem; */}
  right:5rem;
  @media screen and (max-width:768px){
    display:none;
  }
`
const ChatContainer = styled.div`
    display:flex;
    flex-direction:column;
    height:100%;
    jusify-content:center;
    align-items:center;
    @media screen and (max-width:768px){
    display:none;
  }
  }
`
const ConContainer = styled.div`
    display:flex;
    flex-direction:column;
    height:100%;
    jusify-content:center;
    align-items:center;
    @media screen and (max-width:768px){
    display:none;
  }
`
const NavItems = styled.div`
  display:flex;
  flex:1;
  justify-content:center;
  align-items:center;
  @media screen and (max-width:768px){
    display:none;
  }
`
const Avatared = styled(Avatar)`

`
const Header = () => {
  return (
    <>
      <Nav>
       <Logo style={{ fontSize: 40}}/>
        <SearchInfo>
          <SearchIcon />
          <Search/>
        </SearchInfo>
        <NavItems>
        <HomLogo />
          <MLink to='/home'>
            <AddAnnoce style={{ fontSize: 40 }} />
            <h5>Déposer une annonce</h5> 
          </MLink>
        </NavItems>
        <HeaderInfo>
        <ChatContainer>
            <Chat style={{ fontSize: 40}}/>
            <h5>Message</h5>    
        </ChatContainer>
          <ConContainer>
            <Avatared />
            <h5>Se connecter</h5>
          </ConContainer>

        </HeaderInfo>
        </Nav>
    </>
  )
}
export default Header
